import styles from "./Sidebar.module.css"; // ⬅️ без ../../
import chatsIcon from "../../Images/chats.png";
import { useNavigate } from "react-router-dom";

export default function Chats() {
  const navigate = useNavigate();

  return (
    <div className={styles.chats} onClick={() => navigate("/chats")}>
      <img src={chatsIcon} alt="Chats" className={styles.chatsImage} />
      <button className={styles.chatsButton}>Chats</button>
    </div>
  );
}
